import { repeaterData, RepeaterControl } from './gutenberg-repeater-control/index.js';

const { __ } = wp.i18n;
const { registerBlockType } = wp.blocks;
const { RichText, InspectorControls } = wp.blockEditor;
const {
  PanelBody,
  PanelRow,
  TextControl,
  TextareaControl
} = wp.components;

registerBlockType("gb/twocolumnsonbrand", {
  title: __("Two Columns on Brand", "GB"),
  icon: <img src="data:image/png;base64," />,
  category: "faq",
  attributes: {
    hidden: {
      type: "string|array", // It's a string when persisted but when working on gutenberg it's an array
      source: "attribute",
      selector: "select",
      attribute: "hidden",
      default: [],
    },
    contentUA: { type: "string", default: `Frequently asked questions` },
    contentt: {
      type: "string",
      default: `What&#039;s the best thing about Switzerland?`,
    },
    contentUB: {
      type: "string",
      default: `I don&#039;t know, but the flag is a big plus. Lorem ipsum dolor sit amet consectetur adipisicing elit. Quas cupiditate laboriosam fugiat.`,
    },
  },
  edit: function (props) {
    const { attributes, setAttributes } = props;
    const arData = repeaterData(props.attributes.hidden, true);

    return (
      <div className="bg-indigo-700">
        <InspectorControls>
          <PanelBody title="Block settings">
            <PanelRow>
              <b>FAQ's</b>
            </PanelRow>
            <PanelRow>
              <RepeaterControl
                max={10}
                value={props.attributes.hidden}
                onChange={(val) => {
                  props.setAttributes({ hidden: val });
                }}
              >
                {(value, onChange) => {
                  return [
                    <TextControl
                      label="Question"
                      value={value.question}
                      onChange={(v) => {
                        value.question = v;
                        onChange(value);
                      }}
                    />,
                    <TextareaControl
                      label="Answer"
                      value={value.answer}
                      onChange={(v) => {
                        value.answer = v;
                        onChange(value);
                      }}
                    />,
                  ];
                }}
              </RepeaterControl>
            </PanelRow>
          </PanelBody>
        </InspectorControls>
        <div className="max-w-7xl mx-auto py-16 px-4 sm:py-24 sm:px-6 lg:px-8">
          
          <h2 className="text-3xl font-extrabold text-white">
            <RichText
              value={attributes.contentUA}
              default={"Frequently asked questions"}
              onChange={(newtext) => setAttributes({ contentUA: newtext })}
            />
          </h2>
          <div className="mt-6 border-t border-indigo-300 border-opacity-25 pt-10">
            
            <dl className="space-y-10 md:space-y-0 md:grid md:grid-cols-2 md:gap-x-8 md:gap-y-12">
              {arData.map((v) => {
                return (
                  <div>
                    <dt className="text-lg leading-6 font-medium text-white">
                      {v.question}
                    </dt>
                    <dd className="mt-2 text-base text-indigo-200">
                      {v.answer}
                    </dd>
                  </div>
                )
              })}
            </dl>
          </div>
        </div>
      </div>
    );
  },
  save: function (props) {
    const { attributes } = props;
    const arData = repeaterData(props.attributes.hidden, true);

    return (
      <div class="bg-indigo-700">
        
        <div class="max-w-7xl mx-auto py-16 px-4 sm:py-24 sm:px-6 lg:px-8">
          
          <h2 class="text-3xl font-extrabold text-white">
           <RichText.Content value={attributes.contentUA}/>
          </h2>
          <div class="mt-6 border-t border-indigo-300 border-opacity-25 pt-10">
            
            <dl class="space-y-10 md:space-y-0 md:grid md:grid-cols-2 md:gap-x-8 md:gap-y-12">
              
              {arData.map((v) => {
                return (
                  <div>
                    <dt className="text-lg leading-6 font-medium text-white">
                      {v.question}
                    </dt>
                    <dd className="mt-2 text-base text-indigo-200">
                      {v.answer}
                    </dd>
                  </div>
                )
              })}

            </dl>
          </div>
        </div>
      </div>
    );
  },
});
